  02> BISHOP, John Brenchley m on 07.12.1991 to GYDE, Michelle Anne
  b 06.05.1968
  b 04.02.1969
  John b. at Wanganui and m, at New Plymouth, Michelle, d/o Dennis Graeme Gyde and Julie Phillipa
  Reynolds, b. at New Plymouth. Address: 3 Inlet Waters, Whitby, Wellington.
  John was educated at Wanganui Collegiate School and Victoria University, Wellington (BCA in
  Economics and Accountancy, ACA). He won the NZSOA Financial Accounting Prize in 1989. On leaving
  school in 1985 he was awarded a Post Office Bursary to study Economics and on graduating he worked
  for Telecom (NZ) as an economist. In 1990 he became an accountant with Trans Power in Wellington.
  In 1994 he was seconded to Georgia Power and Southern Company Services (Inc) in Atlanta, Georgia,
  USA where he and Michelle lived for 18 months. They travelled widely in North America during that
  time and then spent three months travelling in Europe before returning to New Zealand. John was
  then appointed Assistant Treasurer of Trans Power and in 1996 became Treasurer of Trans Power, a
  job which involves some travel in USA, Asia, Europe, UK and Australia. He enjoys following all
  sport and is an active participant in golf, tennis and touch rugby.
  Michelle was educated at New Plymouth Girls' High School and Victoria University of Wellington (BCA
  in Accountancy, ACA). In 1990 she became an accountant with ANZ Banking Group, and in 1993 was
  appointed Project Accountant with NZ Income Support Service. On returning to New Zealand she was
  appointed Finance Manager - Information Systems with NZ Income Support Service. In 1997 she left
  the paid workforce to start a family. She enjoys playing golf and doing cross-stitch.
  01> BISHOP, Matthew James
  b 02.03.1997
  Matthew b. at Lower Hutt.
  03>' MACLEAN, Helen Mary
  b 28.03.1937
  Helen b. at Wanganui. Address: 9 Cedar Drive, Aramoho, Wanganui.
  Helen was educated at Wanganui Girls' College where she was a Prefect and Dux. She was
  awarded the Lissie Rathbone Scholarship (English and History) and the Helen Macmillan
  Brown Bursary to Helen Connon Hall. She went on to graduate from Canterbury College
  with an MA (Hons) in English, and from Christchurch Teachers' College. She taught
  English, French and Social Studies at Rangi Ruru School, Christchurch (1960-61), then
  spent two years overseas travelling in the United Kingdom and Europe and teaching English for a few
  months at Pitman's Commercial College in London. She returned to Wanganui in 1964, taught for two
  years at Wanganui High School, then became Head of English at Wanganui Girls' College until 1978. In
  1979 she passed her ACTL on the violin and became a Registered Music Teacher and since then she has
  taught the violin (and some viola, cello and double bass) both privately and at Wanganui Collegiate
  School, High School, Girls' College, St George's Prep School, and Saturday morning classes. She also
  plays in a string trio which entertains at functions.
  Since 1976 Helen has been the Regional Representative for World Vision and has visited some projects in
  Asia and Africa. She teaches Bible in Schools, served for some years on the vestry of Christ Church
  and takes the church choir. She is secretary of the Wanganui Branch of the Institute of Registered
  Music Teachers. Her other interests include gardening, travel, chamber music, the Schola Sacra Choir
  and family history.
